/*Table structure for table `cortes` */

DROP TABLE IF EXISTS `cortes`;

CREATE TABLE `cortes` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `caja_id` int(11) NOT NULL,
  `fecha` date NOT NULL,
  `saldo_inicial` decimal(10,2) NOT NULL DEFAULT '0.00',
  `entradas` decimal(10,2) NOT NULL DEFAULT '0.00',
  `capital` decimal(10,2) NOT NULL DEFAULT '0.00',
  `interes` decimal(10,2) NOT NULL DEFAULT '0.00',
  `seguro` decimal(10,2) NOT NULL DEFAULT '0.00',
  `salidas` decimal(10,2) NOT NULL DEFAULT '0.00',
  `desembolsos` decimal(10,2) NOT NULL DEFAULT '0.00',
  `saldo_final` decimal(10,2) DEFAULT '0.00',
  `tipo_caja` int(11) NOT NULL DEFAULT '1' COMMENT '1 cartera 2 oficina',
  `capturista_id` int(11) NOT NULL DEFAULT '1',
  `fecha_captura` date NOT NULL,
  `hora_captura` time NOT NULL,
  `corte_procesado` enum('S','N') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'N',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=627 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

