/*View structure for view estatusActualCliente */

/*!50001 DROP TABLE IF EXISTS `estatusActualCliente` */;
/*!50001 DROP VIEW IF EXISTS `estatusActualCliente` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`financieraleal`@`%.%.%.%` SQL SECURITY DEFINER VIEW `estatusActualCliente` AS (select `c`.`id` AS `id`,concat(`c`.`nombre`,' ',`c`.`appaterno`,' ',`c`.`apmaterno`) AS `cliente`,ifnull((select `desembolsos`.`capital` from `desembolsos` where ((`desembolsos`.`estatus_id` = 5) and (`desembolsos`.`cliente_id` = `c`.`id`))),0) AS `desembolso` from `clientes` `c`) */;

/*View structure for view v_cortes */

/*!50001 DROP TABLE IF EXISTS `v_cortes` */;
/*!50001 DROP VIEW IF EXISTS `v_cortes` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`financieraleal`@`%.%.%.%` SQL SECURITY DEFINER VIEW `v_cortes` AS (select `c`.`caja_id` AS `caja_id`,`c`.`fecha` AS `fecha`,`c`.`tipo_caja` AS `tipo_caja`,(select `cortes`.`saldo_inicial` AS `saldo_inicial` from `cortes` where ((`cortes`.`fecha` = `c`.`fecha`) and (`cortes`.`caja_id` = `c`.`caja_id`) and (`cortes`.`tipo_caja` = 1))) AS `saldo_inicial`,ifnull((select sum(`caja`.`importe`) AS `sum(``caja``.``importe``)` from `caja` where ((`caja`.`caja_id` = `c`.`caja_id`) and (`caja`.`fecha` = `c`.`fecha`) and (`caja`.`tipo_caja` = 1) and (`caja`.`tipo` = 'E'))),0) AS `entradas`,ifnull(if((`c`.`caja_id` = 1),(select sum(`pagos`.`pago_capital`) AS `sum(``pagos``.``pago_capital``)` from `pagos` where (`pagos`.`cliente_id` in (select `clientes`.`id` AS `id` from `clientes` where (`clientes`.`cartera_id` = `c`.`caja_id`)) and (`pagos`.`fecha` = `c`.`fecha`))),0),0) AS `capital`,ifnull(if((`c`.`caja_id` = 1),(select sum(`pagos`.`pago_interes`) AS `sum(``pagos``.``pago_interes``)` from `pagos` where (`pagos`.`cliente_id` in (select `clientes`.`id` AS `id` from `clientes` where (`clientes`.`cartera_id` = `c`.`caja_id`)) and (`pagos`.`fecha` = `c`.`fecha`))),0),0) AS `interes`,ifnull(if((`c`.`caja_id` = 1),(select sum(`pagos`.`pago_seguro`) AS `sum(``pagos``.``pago_seguro``)` from `pagos` where (`pagos`.`cliente_id` in (select `clientes`.`id` AS `id` from `clientes` where (`clientes`.`cartera_id` = `c`.`caja_id`)) and (`pagos`.`fecha` = `c`.`fecha`))),0),0) AS `seguro`,ifnull((select sum(`caja`.`importe`) AS `sum(``caja``.``importe``)` from `caja` where ((`caja`.`caja_id` = `c`.`caja_id`) and (`caja`.`fecha` = `c`.`fecha`) and (`caja`.`tipo_caja` = 1) and (`caja`.`tipo` = 'S'))),0) AS `salidas`,ifnull((select sum(`desembolsos`.`capital`) AS `sum(``desembolsos``.``capital``)` from `desembolsos` where (`desembolsos`.`cliente_id` in (select `clientes`.`id` AS `id` from `clientes` where (`clientes`.`cartera_id` = `c`.`caja_id`)) and (`desembolsos`.`fecha` = `c`.`fecha`))),0) AS `desembolsos`,`c`.`corte_procesado` AS `corte_procesado` from `cortes` `c`) */;

