/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`financieraleal`@`%.%.%.%` SQL SECURITY DEFINER VIEW `v_estadodecuentacliente` AS (select `d`.`id` AS `id`,`d`.`cliente_id` AS `cliente_id`,`d`.`capital` AS `capital`,`d`.`pago_completo` AS `pago_completo`,(case when (`d`.`tipo_id` <> 3) then ifnull((select sum(`corridas`.`saldo`) from `corridas` where ((`corridas`.`desembolso_id` = `d`.`id`) and (`corridas`.`fecha_pago` < curdate()))),0) when (`d`.`tipo_id` = 3) then ifnull((select sum(`corridas_tipo_c`.`saldo`) from `corridas_tipo_c` where ((`corridas_tipo_c`.`desembolso_id` = `d`.`id`) and (`corridas_tipo_c`.`fecha_pago` <= curdate()) and (`corridas_tipo_c`.`estatus_id` = 5))),0) end) AS `saldoVencido`,(case when (`d`.`tipo_id` <> 3) then ifnull((select sum(`corridas`.`saldo`) from `corridas` where ((`corridas`.`desembolso_id` = `d`.`id`) and (`corridas`.`fecha_pago` <= curdate()))),0) when (`d`.`tipo_id` = 3) then ifnull((select sum(`corridas_tipo_c`.`saldo`) from `corridas_tipo_c` where ((`corridas_tipo_c`.`desembolso_id` = `d`.`id`) and (`corridas_tipo_c`.`fecha_pago` <= curdate()) and (`corridas_tipo_c`.`estatus_id` = 5))),0) end) AS `pagoExigible`,(case when (`d`.`tipo_id` <> 3) then ifnull((select sum(`corridas`.`saldo`) from `corridas` where ((`corridas`.`desembolso_id` = `d`.`id`) and (`corridas`.`fecha_pago` <> 0))),0) when (`d`.`tipo_id` = 3) then ifnull((select sum(`corridas_tipo_c`.`saldo`) from `corridas_tipo_c` where ((`corridas_tipo_c`.`desembolso_id` = `d`.`id`) and (`corridas_tipo_c`.`estatus_id` = 5))),0) end) AS `saldoTotal`,`d`.`tipo_id` AS `tipo_id` from `desembolsos` `d` where (`d`.`estatus_id` = 5)) */;

