/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`financieraleal`@`%.%.%.%` SQL SECURITY DEFINER VIEW `v_saldos_cte` AS (select `c`.`id` AS `id`,concat(`c`.`nombre`,' ',`c`.`appaterno`,' ',`c`.`apmaterno`) AS `nombre`,`d`.`capital` AS `capital`,(case when (`d`.`tipo_id` = 3) then (select `corridas_tipo_c`.`saldo` from `corridas_tipo_c` where ((`corridas_tipo_c`.`desembolso_id` = `d`.`id`) and (`corridas_tipo_c`.`estatus_id` = 5))) when (`d`.`tipo_id` <> 3) then (select sum(`corridas`.`saldo`) from `corridas` where (`corridas`.`desembolso_id` = `d`.`id`)) end) AS `saldo`,(case when (`d`.`tipo_id` = 3) then (select (`corridas_tipo_c`.`capital` - `corridas_tipo_c`.`pago_capital`) from `corridas_tipo_c` where ((`corridas_tipo_c`.`desembolso_id` = `d`.`id`) and (`corridas_tipo_c`.`estatus_id` = 5))) when (`d`.`tipo_id` <> 3) then (select (sum(`corridas`.`capital`) - sum(`corridas`.`pago_capital`)) from `corridas` where (`corridas`.`desembolso_id` = `d`.`id`)) end) AS `saldo_capital`,(case when (`d`.`tipo_id` = 3) then (select (`corridas_tipo_c`.`interes` - `corridas_tipo_c`.`pago_interes`) from `corridas_tipo_c` where ((`corridas_tipo_c`.`desembolso_id` = `d`.`id`) and (`corridas_tipo_c`.`estatus_id` = 5))) when (`d`.`tipo_id` <> 3) then (select (sum(`corridas`.`interes`) - sum(`corridas`.`pago_interes`)) from `corridas` where (`corridas`.`desembolso_id` = `d`.`id`)) end) AS `saldo_interes`,(case when (`d`.`tipo_id` = 3) then 0 when (`d`.`tipo_id` <> 3) then (select (sum(`corridas`.`seguro`) - sum(`corridas`.`pago_seguro`)) from `corridas` where (`corridas`.`desembolso_id` = `d`.`id`)) end) AS `saldo_seguro`,`c`.`cartera_id` AS `cartera_id` from (`desembolsos` `d` join `clientes` `c` on((`c`.`id` = `d`.`cliente_id`))) where (`d`.`estatus_id` = 5)) */;

